import React from "react";
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from "./Components/Header"
import Home from "./Page/Home"
function App() {
  return (
    <div className="App">
      <Header/>
      <Router>
      <Switch>
        <Route exact path="/" component={Home} />
      </Switch>
    </Router>
    </div>
  );
}

export default App;
